import axios from "axiosConfig";
import config from "config";
import React, { useEffect, useState } from "react";
import { Select, Divider, Collapse, Form, Button, Row, Col, Card, Input, DatePicker, InputNumber } from 'antd';
import { PlusOutlined, MinusCircleOutlined } from "@ant-design/icons";
import { useHistory, useLocation } from "react-router";
import ConfirmationModal from "components/Modal/ConfirmationModal";
import ENUMS from "constants/appEnums";
import HttpUtil from "util/HttpUtil";
import { useToasts } from "react-toast-notifications";
import { useSelector } from "react-redux";
import FormInitialValues from "constants/formInitialValues";
import moment from "moment";
import FormDataSerializer from "util/FormDataSerializer";

export default function TrackingSheet(props) {
    const { Option } = Select;
    const { Panel } = Collapse;
    const { TextArea } = Input;
    const history = useHistory();
    const locationData = useLocation();
    const { addToast } = useToasts();
    const [dynamicFormNestItemForm] = Form.useForm();
    const [perforationIntervalInformationForm] = Form.useForm();
    const [stageDataForm] = Form.useForm();
    const [propantFormForm] = Form.useForm();
    const [activeDataFormForm] = Form.useForm();
    const [notesDataFormForm] = Form.useForm();

    const [isLoadingFormData, setIsLoadingFormData] = useState(true);
    const project = useSelector(state => state.authReducer.project);
    const [wellId, setWellId] = useState(null);

    const [items, setItems] = useState([{value: 1, label: 'Stage 1'}]);
    const [stageSheetList, setStageSheetList] = useState([]);
    const [selectedStage, setSelectedStage] = useState(1);
    const [showConfirmationModal, setShowConfirmationModal] = useState();
    const [modalData, setModalData] = useState();

    const [resetDynamicFormNestItemValues, setResetDynamicFormNestItemValues] = useState(false);
    const [resetPerforationIntervalInformationValues, setResetPerforationIntervalInformationValues] = useState(false);
    const [resetStageDataValues, setResetStageDataValues] = useState(false);
    const [resetPropantFormValues, setResetPropantFormValues] = useState(false);
    const [resetActiveDataFormValues, setResetActiveDataFormValues] = useState(false);
    const [resetNotesFataFormValues, setResetNotesFataFormValues] = useState(false);
    const [dynamicFormNestItemValues, setDynamicFormNestItemValues] = useState({
        bht_f: null,
        bht_psi: null,
        customer: null,
        date: null,
        event_occur: null,
        field_engineer_days: null,
        field_engineer_nights: null,
        frac_design: null,
        plug_seat_technique: null,
        plug_type: null,
        seismos_data_collection: null,
        stage: null,
        well: null
    })

    const [perforationIntervalInformationValues, setPerforationIntervalInformationValues] = useState({
        acid: null,
        bottom_perf: null,
        clusters_number: null,
        displacement_vol_bottom: null,
        displacement_vol_plug: null,
        displacement_vol_top: null,
        diverter_type: null,
        perf_daiameter: null,
        perf_gun_desc: null,
        plug_depth: null,
        pumped_diverter: null,
        spf: null,
        top_perf: null
    })

    const [stageDataValues, setStageDataValues] = useState({
        stage_start_time: null,
        stage_end_time: null,
        opening_well: null,
        isip: null,
        base_fluid_type: null,
        base_fluid_density: null,
        max_conc_density: null,
        last_description: null,
        last_bbls: null,
        last_ppg: null,
        second_description: null,
        second_bbls: null,
        second_ppg: null,
        third_description: null,
        third_bbls: null,
        third_ppg: null,
        max_prop_conc_ppa_design: null,
        max_prop_conc_ppa_actual: null,
        total_pad_volume_bbls_design: null,
        total_pad_volume_bbls_actual: null,
        total_clean_fluid_volume_bbls_design: null,
        total_clean_fluid_volume_bbls_actual: null,
        total_lbs_design: null,
        total_lbs_actual: null,
        total_sand_lbs_design: null,
        total_sand_lbs_actual: null,
        acid_volume_gals_design: null,
        acid_volume_gals_actual: null,
        flush_volume_bbls_design: null,
        flush_volume_bbls_actual: null,
        slurry_volume_bbls_design: null,
        slurry_volume_bbls_actual: null,
    })

    const [propantFormValues, setPropantFormValues] = useState({
        proppantData: [
            {
                bulk_density: null,
                description: null,
                specific_gravity: null,
            }
        ]
    })

    const [activeDataFormValues, setActiveDataFormValues] = useState({
        amplitude: null,
        frequency: null,
        number_of_pulses: null,
        offset: null,
        periods: null,
        post_end_time: null,
        post_start_time: null,
        pre_end_time: null,
        pre_start_time: null,
    })

    const [notesDataFormValues, setNotesFataFormValues] = useState({
        other_notes: null,
        pre_notes: null,
        post_notes: null
    })


    const handeSelectStage = (e) => {
        setSelectedStage(e);
        if (e) {
            const sheetData = stageSheetList.find(l => l.stage === Number(e))
            if (sheetData) {
                fetchTrackingSheet(sheetData.sheet_id);
            } else {
                resetForm();
            }
        }
    }

    const addItem = () => {
        setItems([...items, {value: (items.length + 1), label: `Stage ${items.length + 1} (Added)`}])
    };

    const handleCancel = () => {
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const addStage = () => {
        setShowConfirmationModal(true);
    }

    const handleAddStageConfirmed = (data) => {
        addItem();
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const dynamicFormNestItemChange = (changedValue, newFormValues) => {
        setDynamicFormNestItemValues(newFormValues);
    }

    const perforationIntervalInformationChange = (changedValue, newFormValues) => {
        setPerforationIntervalInformationValues(newFormValues);
    }

    const stageDataChange = (changedValue, newFormValues) => {
        setStageDataValues(newFormValues);
    }

    const propantFormChange = (changedValue, newFormValues) => {
        setPropantFormValues(newFormValues);
    }

    const activeDataFormChange = (changedValue, newFormValues) => {
        setActiveDataFormValues(newFormValues);
    }

    const notesDataFormChange = (changedValue, newFormValues) => {
        setNotesFataFormValues(newFormValues);
    }


    const onDateChange = (date, dateString)  => {
        console.log(date, dateString);
    }

    const onChange = (date, dateString)  => {
        console.log(date, dateString);
    }

    const handleTrackingSheetSubmit = () => {
        const trackingSheet = FormDataSerializer.trackingSheetSubmitSerializer(
            selectedStage,
            dynamicFormNestItemValues,
            perforationIntervalInformationValues,
            stageDataValues,
            propantFormValues,
            activeDataFormValues,
            notesDataFormValues
        );
        axios.post(config.API_URL + ENUMS.API_ROUTES.TRACKING_SHEET_CREATE + '/' + wellId,
            {
                ...trackingSheet
            }, {...HttpUtil.adminHttpHeaders()})
            .then(res => {
                if (res.status === 201) {
                    addToast("Tracking sheet data added successfully.", { 
                        appearance: 'success',
                        autoDismiss: true
                    });
                    fetchStagesSubmitted(wellId);
                }
            })
            .catch(e => {
                console.log(e)
            });
    }

    const populateFormData = (trackingSheetData) => {
        const dynamicFormNestItemValuesData = {
            bht_f: trackingSheetData.stage_tracking.bht_f,
            bht_psi: trackingSheetData.stage_tracking.bht_psi,
            customer: trackingSheetData.stage_tracking.customer,
            date: moment(trackingSheetData.stage_tracking.date),
            event_occur: trackingSheetData.stage_tracking.did_an_event_occur,
            field_engineer_days: trackingSheetData.stage_tracking.field_engineer.days,
            field_engineer_nights: trackingSheetData.stage_tracking.field_engineer.nights,
            frac_design: trackingSheetData.stage_tracking.frac_design,
            plug_seat_technique: trackingSheetData.stage_tracking.plug_seat_technique,
            plug_type: trackingSheetData.stage_tracking.plug_type,
            seismos_data_collection: trackingSheetData.stage_tracking.seismos_data_collection,
            stage: trackingSheetData.stage_tracking.stage,
            well: trackingSheetData.stage_tracking.well,
        };
        const perforationIntervalInformationValuesData = {
            acid: trackingSheetData.perforation_interval_information.acid,
            bottom_perf: trackingSheetData.perforation_interval_information.bottom_perf,
            clusters_number: trackingSheetData.perforation_interval_information.n_clusters,
            displacement_vol_bottom: trackingSheetData.perforation_interval_information.displacement_volume.bottom_perf,
            displacement_vol_plug: trackingSheetData.perforation_interval_information.displacement_volume.plug,
            displacement_vol_top: trackingSheetData.perforation_interval_information.displacement_volume.top_perf,
            diverter_type: trackingSheetData.perforation_interval_information.diverter_type,
            perf_daiameter: trackingSheetData.perforation_interval_information.perf_daiameter,
            perf_gun_desc: trackingSheetData.perforation_interval_information.perf_gun_description,
            plug_depth: trackingSheetData.perforation_interval_information.plug_depth,
            pumped_diverter: trackingSheetData.perforation_interval_information.pumped_diverter,
            spf: trackingSheetData.perforation_interval_information.spf,
            top_perf: trackingSheetData.perforation_interval_information.top_perf
        };
        const stageDataValuesData = {
            stage_start_time: moment(trackingSheetData.stage_data.stage_start_time),
            stage_end_time: moment(trackingSheetData.stage_data.stage_end_time),
            opening_well: trackingSheetData.stage_data.opening_well,
            isip: trackingSheetData.stage_data.isip,
            base_fluid_type: trackingSheetData.stage_data.fluid_parameters.base_fluid_type,
            base_fluid_density: trackingSheetData.stage_data.fluid_parameters.base_fluid_density,
            max_conc_density: trackingSheetData.stage_data.fluid_parameters.max_conc_density,
            last_description: trackingSheetData.stage_data.fluids_injected_into_formation.last.description,
            last_bbls: trackingSheetData.stage_data.fluids_injected_into_formation.last.bbls,
            last_ppg: trackingSheetData.stage_data.fluids_injected_into_formation.last.ppg,
            second_description: trackingSheetData.stage_data.fluids_injected_into_formation.second_to_last.description,
            second_bbls: trackingSheetData.stage_data.fluids_injected_into_formation.second_to_last.bbls,
            second_ppg: trackingSheetData.stage_data.fluids_injected_into_formation.second_to_last.ppg,
            third_description: trackingSheetData.stage_data.fluids_injected_into_formation.third_to_last.description,
            third_bbls: trackingSheetData.stage_data.fluids_injected_into_formation.third_to_last.bbls,
            third_ppg: trackingSheetData.stage_data.fluids_injected_into_formation.third_to_last.ppg,
            max_prop_conc_ppa_design: trackingSheetData.stage_data.pumping_summary.max_prop_conc.design,
            max_prop_conc_ppa_actual: trackingSheetData.stage_data.pumping_summary.max_prop_conc.actual,
            total_pad_volume_bbls_design: trackingSheetData.stage_data.pumping_summary.total_pad_volume.design,
            total_pad_volume_bbls_actual: trackingSheetData.stage_data.pumping_summary.total_pad_volume.actual,
            total_clean_fluid_volume_bbls_design: trackingSheetData.stage_data.pumping_summary.total_clean_fluid_volume.design,
            total_clean_fluid_volume_bbls_actual: trackingSheetData.stage_data.pumping_summary.total_clean_fluid_volume.actual,
            total_lbs_design: trackingSheetData.stage_data.pumping_summary.total_forty_seventy.design,
            total_lbs_actual: trackingSheetData.stage_data.pumping_summary.total_forty_seventy.actual,
            total_sand_lbs_design: trackingSheetData.stage_data.pumping_summary.total_sand.design,
            total_sand_lbs_actual: trackingSheetData.stage_data.pumping_summary.total_sand.actual,
            acid_volume_gals_design: trackingSheetData.stage_data.pumping_summary.acid_volume.design,
            acid_volume_gals_actual: trackingSheetData.stage_data.pumping_summary.acid_volume.actual,
            flush_volume_bbls_design: trackingSheetData.stage_data.pumping_summary.flush_volume.design,
            flush_volume_bbls_actual: trackingSheetData.stage_data.pumping_summary.flush_volume.actual,
            slurry_volume_bbls_design: trackingSheetData.stage_data.pumping_summary.slurry_volume.design,
            slurry_volume_bbls_actual: trackingSheetData.stage_data.pumping_summary.slurry_volume.actual,
        };
        const propantFormValuesData = {
            proppantData: trackingSheetData.stage_data.propant_data
        };
        const activeDataFormValuesData = {
            wave_type: trackingSheetData.active_data.pilsing_parameters.wave_type,
            periods: trackingSheetData.active_data.pilsing_parameters.periods,
            frequency: trackingSheetData.active_data.pilsing_parameters.freq,
            offset: trackingSheetData.active_data.pilsing_parameters.offset,
            amplitude: trackingSheetData.active_data.pilsing_parameters.amplitude,
            pre_start_time: moment(trackingSheetData.active_data.pre_frac_pulses.start_time),
            pre_end_time: moment(trackingSheetData.active_data.pre_frac_pulses.end_time),
            pre_number_of_pulses: trackingSheetData.active_data.pre_number_of_pulses,
            post_start_time: moment(trackingSheetData.active_data.post_frac_pulses.start_time),
            post_end_time: moment(trackingSheetData.active_data.post_frac_pulses.end_time),
            post_number_of_pulses: trackingSheetData.active_data.post_number_of_pulses, 
        }
        const notesDataFormValuesData = {
            pre_notes: trackingSheetData.notes.pre_frac_pulse,
            post_notes: trackingSheetData.notes.post_frac_pulse,
            other_notes: trackingSheetData.notes.other,
        }

        setDynamicFormNestItemValues(dynamicFormNestItemValuesData);
        setPerforationIntervalInformationValues(perforationIntervalInformationValuesData);
        setStageDataValues(stageDataValuesData);
        setPropantFormValues(propantFormValuesData);
        setActiveDataFormValues(activeDataFormValuesData);
        setNotesFataFormValues(notesDataFormValuesData);
        setIsLoadingFormData(false);
    }

    const fetchTrackingSheet = (sheet_id) => {
        axios.get(config.API_URL + ENUMS.API_ROUTES.TRACKING_SHEET + '/' + sheet_id,
        {
            ...HttpUtil.adminHttpHeaders(),
        })
        .then(res => {
            console.log(res.data);
            if (res.status === 200 && res.data) {
                // populate tracking sheeet
                populateFormData(res.data);
            }
        })
        .catch(e => {
            console.log(e)
        })
    }

    const populateStageDropdown = (numOfStages) => {
        const stages = [];
        for (let step = 1; step <= numOfStages; step++) {
            stages.push({value: step, label: `Stage ${step}`});
        }
        return stages;
    }

    const fetchStagesSubmitted = (well_id) => {
        const stages = populateStageDropdown(project.wells.find(well => well.id === well_id).num_stages);

        axios.get(config.API_URL + ENUMS.API_ROUTES.TRACKING_SHEET_LIST + '/' + well_id,
        {
            ...HttpUtil.adminHttpHeaders(),
        })
        .then(res => {
            if (res.status === 200 && res.data) {
                setItems(stages);
                setStageSheetList(res.data.stages);
                setSelectedStage(selectedStage + "");
                if (res.data.stages.length > 0) {
                    const stageTrackingPresent = res.data.stages.find(s => s.stage === stages[0].value)
                    if (stageTrackingPresent) {
                        fetchTrackingSheet(stageTrackingPresent.sheet_id);
                    }
                } else {
                    setIsLoadingFormData(false);
                }
            }
        })
        .catch(e => {
            console.log(e)
        })
    }

    const resetForm = () => {
        setDynamicFormNestItemValues(FormInitialValues.dynamicFormNestItemValues);
        setPerforationIntervalInformationValues(FormInitialValues.perforationIntervalInformationValues);
        setStageDataValues(FormInitialValues.stageDataValues);
        setPropantFormValues(FormInitialValues.propantFormValues);
        setActiveDataFormValues(FormInitialValues.activeDataFormValues);
        setNotesFataFormValues(FormInitialValues.notesFataFormValues);
        form.resetFields();
    }

    useState(() => {
        if(project && locationData.pathname === (ENUMS.ROUTES.ADMIN + ENUMS.ROUTES.TRACKING_SHEET)) {
            console.log(`first time: ${locationData.pathname}`) 
            if (locationData.state && locationData.state.wellId) {
                console.log(locationData.state.wellId);
                setWellId(locationData.state.wellId);
                resetForm();
                fetchStagesSubmitted(locationData.state.wellId);
            }
            else if (locationData.search) {
                const params = new URLSearchParams(locationData.search);
                const wellIdSearch = params.get('wellId');
                console.log(wellIdSearch);
                setWellId(wellIdSearch);
                resetForm();
                fetchStagesSubmitted(wellIdSearch);
            }
        }
    }, [project])

    useEffect(() => {
        return history.listen((location) => { 
            if(location.pathname === (ENUMS.ROUTES.ADMIN + ENUMS.ROUTES.TRACKING_SHEET)) {
